import { Route, Switch } from 'react-router-dom'
import './App.css';

import Header from './components/Header/index';
import Footer from './components/Footer/index';

async function App() {
  return (
    <div className="App">
      await <Header />
      <Footer />
    </div>
  );
}

export default App;
